import "./App.css";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import About from "./About";
import Home from "./Home";

function App() {
  return (
    <Router>

        <Route exact={true} path='/'>
          <Home />
        </Route>

        <Route path='/about'>
          <About />
        </Route>

    </Router>
  );
}

export default App;
